// BannerAd.js
import React from 'react';
import bannerImage from './path/to/your-image.jpg'; // Adjust the path as necessary

const BannerAd = () => {
  return (
    <div className="banner-ad">
      <img src={bannerImage} alt="Banner Ad" className="banner-image" />
    </div>
  );
};

export default BannerAd;
